import { performFetch } from './BaseApiRemote';

const ip = '127.0.0.1';
const port = '5000';

export const getUserById = (userId) => {
  const url = `http://${ip}:${port}/users/id/${userId}`;
  return performFetch(url, { method: 'GET', });
}

export const getUsers = () => {
  const url = `http://${ip}:${port}/users`;
  return performFetch(url, { method: 'GET', });
}
